        primary key,
    timestamp                      datetime(6)     not null,
    requested_service              longtext        null,
    ip                             char(39)        not null,
    longitude                      double          null,
    latitude                       double          null,
    autonomous_system_organization longtext        null,
    country_name                   longtext        null,
    city_name                      longtext        null,
    user                           longtext        null,
    event                          longtext        null,
    message                        longtext        null,
    http_status                    int unsigned    null,
    user_agent                     longtext        null,
    request_method                 varchar(10)     null,
    content_size                   bigint unsigned null,
    is_tor                         tinyint(1)      not null,
    service_id                     bigint          not null,
    ids_score                      double    not null,
    constraint http_logs_servicelog_service_id_63ffc9ad_fk_http_logs_service_id
        foreign key (service_id) references http_logs_service (id),
